script: |
  super -f text -I q5020.spq | sort > q5020.out

inputs:
  - name: q5020.spq
    data: |
      SELECT DISTINCT - col0 FROM tab0 (FORMAT parquet) WHERE NOT - 36 * + col2 * - col2 + + col1 - - - CAST ( NULL AS INTEGER ) <> col2 * + col1;
  - name: tab0

outputs:
  - name: q5020.out
    data: |
